script: |
  super -f text -I q8118.spq | sort > q8118.out

inputs:
  - name: q8118.spq
    data: |
      SELECT - col0 FROM tab1 (FORMAT parquet) WHERE + col0 NOT BETWEEN - col2 * + ( - col2 * 16 ) + - col1 * col1 AND + 24;
  - name: tab1

outputs:
  - name: q8118.out
    data: |
      -51
      -85
      -91
